    if (ThreatLevel > HighThreatThreshold)
    {
        FocusOnDefense();
    }
    else if (GetResources() > ExpansionResourceThreshold)
    {
        FocusOnExpansion();
    }
    else
    {
        FocusOnResourceGathering();
    }
